import React from 'react';

const ServicesPage = () => {
  return (
    <div>
      <h1>Наши услуги</h1>
      <p>Компания "ТехноСистемы" предоставляет широкий спектр услуг по автоматизации торговых точек, включая:</p>
      <ul>
        <li>Разработка программного обеспечения для кассовых аппаратов и терминалов.</li>
        <li>Настройка и установка POS-систем для магазинов и ресторанов.</li>
        <li>Обслуживание и поддержка банкоматов и платёжных терминалов.</li>
        <li>Интеграция систем оплаты и управления складом.</li>
      </ul>

      <a href="/contact" className="button">Связаться с нами</a>
    </div>
  );
};

export default ServicesPage;
